import './card.css'

import parse from "html-react-parser";

function Card(props){
  return(
    <div className="card-container">
    <div className="card">
      <img src={props.imgUrl}/>
      <h3>{props.title}</h3>
      <p>{parse(props.description)}</p>
      <p className="link-container">
      <a href={props.link}>{props.linkTitle}</a> <i class="fa fa-angle-double-right" aria-hidden="true"></i>
      </p>
    </div>

    </div>

  );
}
export default Card
